export class FrmLoginController{

        static async ValidarLogin(parUsuario:string,parSenha:string){
            return await fetch(`http://localhost:56624/api/Usuario/ValidarUsuario?parLogin=${"admin"}&parSenha=${"admin"}`).then((res)=> res.json()).catch(
                (err)=>{ console.log(err); alert("ERRO WEB API: " + err)})            
        }
        static async getUser() {
            try {
              const response = await fetch(`http://localhost:56624/api/Usuario/ValidarUsuario?parLogin=${"admin"}&parSenha=${"admin"}`, {
                method: 'GET',
                headers: {
                  accept: 'application/json',
                },
              });
          
              if (!response.ok) {
                throw new Error(`Error! status: ${response.status}`);
              }
          
              const result = await response.json();
              return result;
            } catch (err) {
              console.log(err);
            }
          }
}
